function initSankeyData(){

    var populations = [];

    lyr.f.forEach(function(d,i){
        d.color = graphics2D.color(d.name);
        d.index = citynameIndexMap.indexOf(d.name);
        d.array =  migrationmatrix[d.index];

        d.population  = 0;
        for( var i = 0; i < 8;  i++){
            d.population = d.population + migrationmatrix[d.index][i];
        }
        populations.push(d.population);
    });


    var scalehight = d3.scaleLinear().domain([0,d3.max(populations)]).range([0,20]);

    lyr.f.forEach(function(d,i){
        d.h = scalehight(d.population);
        //d.h = 5;
    });
}

function updateSankeyData(){
    lyr.f.forEach(function(d,i){
        d.h = i * 100;
    });
}